import BacktoMain from "../images/Icon_ArrowBack.png";
import { Link } from "react-router-dom";

function Header() {
  return (
    // <img
    //   src={BacktoMain}
    //   alt="ArrowBack"
    //   className="absolute w-[25px] h-[25px] mt-[40px] ml-[-300px]"
    // />
    <Link to="../main">
      <button>
        <img
          src={BacktoMain}
          alt="ArrowBack"
          className="w-[25px] h-[25px] mt-[40px] ml-[-20px]"
        ></img>
      </button>
    </Link>
  );
}

export default Header;
